import pytest
import inspect
import solution_238


@pytest.mark.parametrize("f", [f[1] for f in inspect.getmembers(solution_238, predicate=inspect.isfunction)])
def test_example_1(f):
    nums = [1, 2, 3, 4]
    output = [24, 12, 8, 6]

    assert f(nums) == output


@pytest.mark.parametrize("f", [f[1] for f in inspect.getmembers(solution_238, predicate=inspect.isfunction)])
def test_example_2(f):
    nums = [-1, 1, 0, -3, 3]
    output = [0, 0, 9, 0, 0]

    assert f(nums) == output


